  false,\n\t\"url\": null,\n\t\"notes\": \"The shaded relief raster data was created
  based on bathymetry obtained in the meander reach collected in about a one month
  period extending from 6/3/2010 - 6/19/2010. This subset data extends from river
  kilometer designator 228 upstream to 237. Similar methods used to collect and process
  the bathymetry are described in Fosness (2013). The shaded relief was created from
  a surface raster (also referred to as digital elevation model) of the bathymetry
  data and displays the illumination angle of the surface raster. The shaded relief
  data provides an appearance of three-dimensional space through the use of shading
  and lighting.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
